// import Info from './Info';

export default function Person(props) {

    let borderStyle = {
        backgroundColor: "CornflowerBlue"
        // border: "darkblue 2px dotted"
    }
    // HotPink
    // CornflowerBlue

    return (
        <div style={borderStyle}>
            <h3>{props.name}</h3>
            <p>{props.age}</p>
            <p>{props.city}</p>
            <p>{props.hoobies}</p>
            <p>{props.gender}</p>

            {/* <Info info={props.age}/>
            <Info info={props.city}/>
            <Info info={props.hoobies}/> */}
        </div>
    )
}
